@fauzulfernandoe bantuan yang ditunggu-tunggu warga Kota Tasikmalaya disalurkan. Sebanyak 2.850 Kepala Rumah Tangga Sasaran (KRTS) berhak mendapat bantuan yang bersumber dari Pemerintah Provinsi Jawa Barat tersebut. Bantuan sendiri berupa uang tunai senilai Rp 150.000 dan sembako seperti beras 10 kilogram, makanan kaleng 2 kilogram atau 4 kaleng, gula 1 kilogram, minyak 2 liter, terigu 1 kilogram, vitamin c 1 paket dan 16 buah mie instan 16 dengan total sebesar Rp 350.000.
Sumber: https://www.radartasikmalaya.com/hari-ini-2-850-warga-kota-tasik-dibagi-sembako-ini-hitungannya/
Artikel ini telah terbit di radartasikmalaya.com

